import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

import { UserRouteAccessService } from 'app/core/auth/user-route-access.service';
import { EditHardcopyEcComponent } from '../edit-hardcopy-ec/edit-hardcopy-ec.component';
import {ViewCpfComponent} from "app/claim/ec-claim/pop-up/view-cpf/view-cpf.component";
import { EmpClaimVerificationComponent } from '../ec-claim-verification/ec-claim-verification.component';
import {ViewLatestOwnerEcComponent} from "app/claim/ec-claim/pop-up/view-latest-owner-ec/view-latest-owner-ec.component";
import {ViewPastClaimComponent} from "app/claim/pop-up/view-past-claim/view-past-claim.component";
import {ViewCpfDeviationComponent} from "app/claim/ec-claim/pop-up/view-cpf-deviation/view-cpf-deviation.component";
import { ViewSupportingDocComponent } from 'app/claim/pop-up/view-supporting-doc/view-supporting-doc.component';
import { ViewEClaimComponent } from 'app/claim/ec-claim/pop-up/view-eclaim/view-eclaim.component';
import { ViewRemarksComponent } from 'app/claim/pop-up/view-remarks/view-remarks.component';


const deductionRoutes: Routes = [
  {
    path: 'edit-hardcopy-ec',
    component: EditHardcopyEcComponent,
    data: {
      pageTitle: 'nspay2App.claim.employed-claim.edit-hardcopy-ec.home.title',
      defaultSort: 'id,asc'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'view-cpf',
    component: ViewCpfComponent,
    data: {
      pageTitle: 'nspay2App.claim.employed-claim.view-cpf.home.title'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'edit-hardcopy-ec/:caseId',
    component: EditHardcopyEcComponent,
    data: {
      pageTitle: 'nspay2App.claim.employed-claim.edit-hardcopy-ec.home.title',
      defaultSort: 'caseId,asc'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'claim-verification-ec',
    component: EmpClaimVerificationComponent,
    data: {
      pageTitle: 'nspay2App.claim.employed-claim.claim-verification-ec.home.title',
      defaultSort: 'caseId,asc'
    },
    canActivate: [UserRouteAccessService],
  },
  {
    path: 'view-latest-owner',
    component: ViewLatestOwnerEcComponent,
    data: {
      pageTitle: 'nspay2App.claim.employed-claim.view-latest-owner.home.title'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'view-past-claim',
    component: ViewPastClaimComponent,
    data: {
      pageTitle: 'nspay2App.claim.view-past-claim.home.title'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'view-cpf-deviation',
    component: ViewCpfDeviationComponent,
    data: {
      pageTitle: 'nspay2App.claim.employed-claim.view-cpf-deviation.home.title'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'view-supporting-doc',
    component: ViewSupportingDocComponent,
    data: {
      pageTitle: 'nspay2App.claim.view-supporting-doc.home.title'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'view-eclaim',
    component: ViewEClaimComponent,
    data: {
      pageTitle: 'nspay2App.claim.view-eclaim.home.title'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'view-remarks',
    component: ViewRemarksComponent,
    data: {
      pageTitle: 'nspay2App.claim.view-remarks.home.title'
    },
    canActivate: [UserRouteAccessService]
  },

];

@NgModule({
  imports: [RouterModule.forChild(deductionRoutes)],
  exports: [RouterModule]
})

export class ECClaimRoutingModule { }
